import ExpenseItem from './components/ExpenseItem';

function App() {
  state = {
    expenses: [
      {
        id: 'e1',
        title: 'Toilet Paper',
        amount: 94.12,
        date: new Date(2020, 7, 14)
      },
      {
        id: 'e2',
        title: 'New TV',
        amount: 799.49,
        date: new Date(2021, 2, 12)
      },
      {
        id: 'e3',
        title: 'Car Insurance',
        amount: 294.67,
        date: new Date(2021, 2, 28)
      }
    ]
  }

  inputItems = () => {
    state.expenses.map(expense => {
      return <ExpenseItem 
        title={expense.title}
        amount={expense.amount}
        date={expense.date}
      />
    })
  }

  return (
    <div>
      <h2>Let's get started!</h2>
      inputItems;
    </div>
  );
}

export default App;
